import React, { Component } from 'react'
import Newsitem  from './Newsitem'

export class News extends Component {
  render() {
    return (
        <>
      <p>This is News component</p>
        <Newsitem title="mytitle" description="This is my description"/>    
        <Newsitem/>
        <Newsitem/>
        <Newsitem/>
        
          </>
    )
  }
}

export default News
